    /*
        i
        abcabcbb
           j
        abcabcbb


     */

    public static int lengthOfLongestSubstring(String s) {
        if (s.length() == 0) return 0;
        if (s.length() == 1) return 1;

        int length = 1;
        int maxLength = 0;

        int p1 = 0;
        int p2 = 1;

        String substring = s.substring(0, p2);
        CharSequence charSequence = "";

        while (p2 < s.length()) {

            charSequence = s.substring(p2-1,p2);
            if (substring.contains(charSequence)) { //
                p1++;
                p2 = p1+1;
                if (maxLength < length) maxLength = length;
                length = 0;

            } else {
                p2++;
                substring = s.substring(p1, p2);
                length++;
                if (maxLength < length) maxLength = length;
            }

        }


        return maxLength;
    }


